import React, { Component } from "react";
import "./App.css";
import Navbar from "./components/Navbar";
import CourseList from "./components/CourseList";

export class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      error: null,
      isLoaded: false,
      response: [],
    };
  }

  render() {
    return (
      <div>
        <Navbar />
        <CourseList />
      </div>
    );
  }
}

export default App;
